var time = json.times.map(m=> {
	if(m){
		return {
      Time:moment(m.time).zone(5).format('ha'),
      AllTime:moment(m.time).zone(5).format('ddd'),
      AllTime2:m.time,
      Entrances: m.entrances,
      Exit: m.exits
    }
  }
});
console.log(time);
let pmWeekday = new Array();
let pmWeekEnd = new Array();

var pm = time.filter((m)=>{
	if(m && m.Time === '1am'){
  	if(m.AllTime === 'Sun' || m.AllTime === 'Sat')
    	pmWeekEnd.push(m);
    else
  		pmWeekday.push(m);
  }
});
console.log(pmWeekday);console.log(pmWeekEnd);

var pmWeekdayEntrances = pmWeekday.map(el=> {
  if(el)return el.Entrances;
  else return 0;
});

var pmWeekdayExit = pmWeekday.map(el=> {
  if(el)return el.Exit;
  else return 0;
});
console.log('平日')
console.log(SumDatareduce(pmWeekdayEntrances)/20);
console.log(SumDatareduce(pmWeekdayExit)/20);

